def get_dict(d, k):
    try:
        v = d[k]
    except:
        v = k
    return v
def extract_values(path, r_map = dict()):
    fin = open(path)
    header = fin.readline().strip()
    colnames = header.split("\t")
    ds = [set() for _ in range(len(colnames))]
    while True:
        line = fin.readline()
        if line == "":
            break
        parts = line.strip().split("\t")
        # assert len(parts) == len(colnames), "%s\t%s" % (line, path)
        for i,v in enumerate(parts):
            seperator = ";"

            if v.__contains__("|") and path.__contains__("drug"):
                seperator = "|"
            elif v.__contains__(", ") and path.__contains__("reac"):
                seperator = ", "
            vis = v.split(seperator)
            for vi in vis:
                vi = get_dict(r_map, vi)
                if colnames[i] == "RouteOfAdministration":
                    if len(vi) > 1 and not vi[0].isnumeric():
                        ds[i].add(vi)
                elif vi not in EXCEPTION_TOKENS:
                    ds[i].add(vi)
    fin.close()
    return ds, colnames

