def correct_column_name(n):
    if n[-2:] == "Id":
        return n[:-2]
    return n
def sortingx(ll, no_except=False):
    """
    Fixing order of 10's, 100's, Less than 10...., Other, Not clear
    """
    ll = sorted(list(ll))
    # if len(ll) < 100:
    #     print("Call sorting...", list(ll))

    ll2 = []
    is_empty_first = False
    if ll[0] == "" or ll[0] == " ":
        is_empty_first = True
        ll = ll[1:]
    if no_except:
        ll = sorted(ll)
    elif ll[0][0].isnumeric():
        # print(ll)
        for l in ll:
            if len(l) > 2 and l[0].isnumeric() and not l[2].isnumeric():
                ll2.append("0" + l)
            elif l.__contains__("Less than 10") or l.__contains__("Under 10"):
                ll2.append("-" + l)
            else:
                ll2.append(l)
        ll2 = sorted(ll2)
        ll3 = []
        for l in ll2:
            if l[0] == "0" or l[0] == "-":
                ll3.append(l[1:])

            else:
                ll3.append(l)
        ll = ll3
    elif "Other" or "Not clear" in ll:
        ll2 = []
        for l in ll:
            if l == "Other" or l == "Not clear":
                ll2.append("ZZ" + l)
            else:
                ll2.append(l)
        ll2 = sorted(ll2)
        ll3 = []
        for l in ll2:
            if l.startswith("ZZ"):
                l = l[2:]
            ll3.append(l)
        ll = ll3
    if is_empty_first:
        ll = [" "] + ll
    return ll
def encoding():
    print("Start encoding...")
    fEncodingGlobalInfo = open("data/TSUI_Encoded/EncodedColumnValues", "w")
    fEncodingGlobalInfo.write("Table name\tColumn Name\tCoded Value\tDescription\n")
    global_remap = load_remap_global()

    for path in glob.glob("resource/*_final.txt"):
        list_list_column_values, colnames = extract_values(path, global_remap)

        TB_NAME = path.split("/")[-1][:4].upper()
        print(path)
        print(colnames)
        valid_col_ids = set()
        d_remaps = dict()
        for i,colums_values in enumerate(list_list_column_values):

            if colnames[i] not in GLOBAL_COLUMNS and colnames[i] not in SEP_COLUMS:
                continue
            if colnames[i] in SEP_COLUMS:
                finfo = open("data/TSUI_Encoded/%sList" % correct_column_name(colnames[i]), "w")
                finfo.write("%s\t%sId\n" % (correct_column_name(colnames[i]), correct_column_name(colnames[i])))
            else:
                finfo = fEncodingGlobalInfo
            valid_col_ids.add(i)
            dremapi = dict()
            d_remaps[i] = dremapi
            colums_values = sortingx(colums_values, colnames[i] == "RouteOfAdministration")
            if colums_values[0] == "" or colums_values[0] == " ":
                offset = 0
            else:
                offset = 1
            for j in range(len(colums_values)):
                if colums_values[j] == "" or colums_values[j] == " ":
                    continue
                dremapi[colums_values[j]] = "%s" % (j + offset)
            for j in range(len(colums_values)):
                if colums_values[j] == "" or colums_values[j] == " ":
                    continue
                if colnames[i] in GLOBAL_COLUMNS:
                    finfo.write("%s\t%s\t%s\t%s\n" % (TB_NAME, colnames[i],j + offset, colums_values[j]))
                else:
                    finfo.write("%s\t%s\n" % (colums_values[j], j + offset))

            if colnames[i] in SEP_COLUMS:
                finfo.close()

        fout = open("data/TSUI_Encoded/%s" % TB_NAME, "w")
        colnams2 = []
        for col in colnames:
            col0 = col
            col = correct_column_name(col)
            if col0 in SEP_COLUMS or col0 in GLOBAL_COLUMNS:
                colnams2.append("%sId" % col)
            else:
                colnams2.append(col)
        fout.write("\t".join(colnams2) + "\n")
        fin = open(path)
        fin.readline()
        ic = 0
        while True:
            ic += 1
            if ic % 100 == 0:
                print("\r%s" % ic, end="")
            line = fin.readline()

            if line == "":
                break
            # Fix the remaining tokens
            line = line.replace("ä¸æ˜Ž", "Not clear")
            parts = line.strip().split("\t")
            ss = []

            for i, c_value in enumerate(parts):

                if i in valid_col_ids:
                    # print("Writing: ", colnams[i])
                    dremapi = d_remaps[i]
                    if c_value == "" or c_value == " ":
                        ss.append(c_value)
                    else:
                        seperator = ";"
                        if c_value.__contains__("|") and TB_NAME == "DRUG":
                            seperator = "|"
                        elif c_value.__contains__(", ") and TB_NAME.__contains__("DRUG"):
                            seperator = ", "
                        c_value_s = c_value.split(seperator)
                        c_value_ss = []
                        for c_v in c_value_s:
                            if c_v == "" or c_v == " ":
                                continue
                            try:
                                c_v = get_dict(global_remap, c_v)
                                vx = dremapi[c_v]
                            except:
                                vx = -1
                            if vx != -1:
                                c_value_ss.append(vx)
                        ss.append(";".join(c_value_ss))
                else:
                    ss.append(c_value)
            # print(ss)
            fout.write("\t".join(ss) + "\n")
        fout.close()
        fin.close()
        print("Done ", path)
    fEncodingGlobalInfo.close()

def convert_tsui_ml():
    def load_map(path):
        d = dict()
        fin = open(path)
        fin.readline()
        while True:
            line = fin.readline()
            if line == "":
                break
            parts = line.lower().strip().split("\t")
            d[parts[0].strip()] = parts[1].strip()
        fin.close()
        return d
    d_drugmap = load_map("data/TSUI_Encoded/ActiveIngredientList")
    d_adrmap = load_map("data/TSUI_Encoded/AdverseEventPreferredTermList")
    fin = open("data/TSUI_ML.txt")
    fout = open("data/TSUI_Encoded/TSUI_ML_Encoded.txt", "w")
    fout.write(fin.readline())
    while True:
        line = fin.readline()
        if line == "":
            break
        parts = line.strip().split(",")
        fout.write("%s\t%s\t%s\t%s\n"% (d_drugmap[parts[0].strip()], d_drugmap[parts[1].strip()], d_adrmap[parts[2].strip()], "\t".join(parts[3:])))
    fout.close()
    fin.close()

def load_remap_global(path="resource/GlobalRemap_Revised_PP.txt"):
    fin = open(path)
    fin.readline()
    c_dict = {}
    r_dict = {}
    while True:
        line = fin.readline()
        if line == "":
            break
        # print(line.strip())
        parts = line.strip().split("\t")
        com = parts[-1]
        if com == "OK":
            if parts[2] == "1":
                c_dict = dict()
            c_dict[parts[2]] = parts[3]
            continue
        if com.startswith("Better as "):
            com = com[10:].capitalize()
            c_dict[parts[2]] = com
        elif com.startswith("Same as "):
            # print(com, c_dict)
            com = com[8:]
            com = c_dict[com]
            c_dict[parts[2]] = com
        r_dict[parts[3]] = com
    fin.close()
    return r_dict


def run():
    encoding()
    convert_tsui_ml()
if __name__ == "__main__":
    run()